/*Table structure for table `expenses` */

DROP TABLE IF EXISTS `expenses`;

CREATE TABLE `expenses` (
  `name` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名（购买）',
  `data` datetime DEFAULT NULL COMMENT '时间（购买）',
  `business_no` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '业务订单号',
  `order_sum` varchar(128) DEFAULT NULL COMMENT '金额',
  `pay_type` int(22) DEFAULT NULL COMMENT '支付方式',
  `order_info` varchar(256) DEFAULT NULL COMMENT '购买内容',
  PRIMARY KEY (`name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

