/*Table structure for table `provider_produt` */

DROP TABLE IF EXISTS `provider_produt`;

CREATE TABLE `provider_produt` (
  `id` int(32) NOT NULL AUTO_INCREMENT COMMENT '服务产品id',
  `provider_id` varchar(32) DEFAULT NULL COMMENT '服务商id',
  `service_name` varchar(16) DEFAULT NULL COMMENT '服务名称',
  `service_info` varchar(128) DEFAULT NULL COMMENT '服务简介',
  `service_img` varchar(64) DEFAULT NULL COMMENT '服务产品图片',
  `service_content` varchar(1024) DEFAULT NULL COMMENT '服务内容',
  `price` int(22) DEFAULT NULL COMMENT '服务价格',
  `sales_num` int(22) DEFAULT NULL COMMENT '销量',
  `region` varchar(32) DEFAULT NULL COMMENT '地区',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `recommend` int(22) DEFAULT NULL COMMENT '是否推荐产品（1：是 2：否）',
  `necessary` int(22) DEFAULT NULL COMMENT '是否初创必备（1：是 2：否）',
  `status` int(22) DEFAULT NULL COMMENT '状态（1:在线 2:下线）',
  `img` blob COMMENT '服务产品图片',
  PRIMARY KEY (`id`),
  KEY `a` (`provider_id`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8;

