/*Table structure for table `region` */

DROP TABLE IF EXISTS `region`;

CREATE TABLE `region` (
  `ID` varchar(96) DEFAULT NULL,
  `NAME` varchar(192) DEFAULT NULL,
  `LEVEL` decimal(2,0) DEFAULT NULL,
  `PARENT_ID` varchar(96) DEFAULT NULL,
  `POST_CODE` varchar(48) DEFAULT NULL,
  `REGION_CODE` varchar(48) DEFAULT NULL
