/*Table structure for table `xd_user` */

DROP TABLE IF EXISTS `xd_user`;

CREATE TABLE `xd_user` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '用户',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `password` varchar(15) DEFAULT NULL COMMENT '密码',
  `head_img` varchar(30) DEFAULT NULL COMMENT '用户头像',
  `name` varchar(8) DEFAULT NULL COMMENT '用户名字',
  `email` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `status` varchar(8) DEFAULT NULL COMMENT '登录状态（1已登录、未登录0）',
  `ts` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `cmbProvince` varchar(22) DEFAULT NULL COMMENT '省',
  `cmbCity` varchar(22) DEFAULT NULL COMMENT '市',
  `cmbArea` varchar(22) DEFAULT NULL COMMENT '区',
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8;

